                    <li><Button onclick={handleChoice(40000)}>25 miles</Button></li>
                </ul>
                <Button onClick={handlePage}>Back</Button>
            </div>
        );
    }
    else if(props.pageProp === 'start'){
        return(
            <div>
                <App/ >
            </div>
        );
    }
    else{
        return(<div>{props.pageProp}</div>);
    }


}
export default Distance;
